text:
@NoSoyPerno @GastonGiribet 👇
O sea, sí, si apuntaras el Hubble a ese espejo a un año luz de aquí (que no es tanto, ya que es más cerca que la estrella más cercana al Sol) verías la imagen de lo que aquí, en la Tierra, estaba sucediendo en 2019.
👇

@NoSoyPerno @GastonGiribet 👇
Si no recuerdo mal, la película Contacto (o la novela, ya me las confundo) juega con esa imagen; en ese caso lo que rebota y regresa tarde es una señal de televisión, pero es lo mismo que la imagen. 
👇

@NoSoyPerno @GastonGiribet 👇
Esto no es un experimento imaginario, sino que se hizo. Por supuesto, no se hizo a tal distancia ni con telescopios, pero sí con espejos desde la Luna y lásers. El láser tarda más de dos segundos en regresar. Lo mismo pasaría con cualquier imagen. 
👇

@NoSoyPerno @GastonGiribet 👇
Si es así, en efecto: veríamos imágenes de hace dos años. Por ejemplo, yo saludaría desde la Tierra, esperaría dos años, miraría por el espejo, y recién ahí vería mi imagen saludándome. 
👇

